77364"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"77455","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"zczMzMwor0BSuB6FawCvQD0K16Nwaq9A7FG4HgWPr0BSuB6F65SvQDMzMzOzZq9Aj8L1KNySr0CF61G4nrmvQClcj8L1aa9AZmZmZmapr0AzMzMzszqwQI/C9SgcP7BApHA9ClcZr0BI4XoUrjOvQOF6FK7HMa9A16NwPYqOrkCkcD0K19StQGZmZmbmlq1AMzMzMzOTrUCPwvUoXDqtQK5H4XoU1q1Aw/UoXI/ZrUDD9Shcj1CtQEjhehQu8a1AH4XrUTjjrUAK16NwvSCuQM3MzMzMNa5A7FG4HgWArUBSuB6Fa6StQGZmZmbmSK9AuB6F61GKr0BxPQrXI2evQIXrUbgena9AXI/C9Si/r0DhehSuR3SvQOF6FK5HQa9AmpmZmZkMr0DD9Shcj7GuQNejcD2K161AzczMzMwXrUCPwvUo3HquQKRwPQrXZ65ApHA9ClewrUBxPQrXI2iuQK5H4XoUB69AZmZmZmb0rkDhehSuR8quQFyPwvWo/65A9ihcj0LvrkBcj8L1qAKvQPYoXI9CmK5AAAAAAIDLrkBI4XoUrr6uQClcj8L1HK9ArkfhepSnrkAfhetRuBGuQBSuR+H6oa1Aw/UoXA/hrUBmZmZm5hOuQFK4HoVrda5AMzMzM7OfrkDD9
